# The Base layer provides a refined structure over data that has been ingested. It represents a version of our data that can be trusted for downstream workloads. The Base layer has  the following characteristics:
# <table border="0" style="border:none;" width="100%"><tr><td style="border:none;" width="50%">
# 
# - Data is loaded to delta parquet format and exposed in delta tables
# - Data is cleansed
# - Data is deduplicated
# - Quality rules are enforced
# - Renaming can be applied on both tables and columns
# - Errors are handles
# - Nulls are replaced
# - Nested data can be exploded/projected into multiple silver objects or flattened
# - Functional history (SCD2/4) may be applied
# - Keys may be applied 
# </td><td align="center" style="border:none;">
# 
